der has<br />\r\nbeen authorized (debit or credit card), your Take-out Order will be transmitted to the Restaurant from which<br />\r\nyou ordered. Once you have submitted your Take-out Order and your payment has been authorized, you<br />\r\nWILL NOT be entitled to change your order. You are responsible to ensure that all the details of your Takeout<br />\r\nOrder (including your billing and delivery address) are complete and accurate.</p>\r\n\r\n<p><br />\r\nAny notification sent to you by the Platform confirming your Take-out Order only means that the Takeout<br />\r\nOrder has been received and is being processed by us, and DOES NOT necessarily mean that your<br />\r\nTake-out Order has been accepted by the Restaurant. We encourage all the Restaurants to accept all<br />\r\nTake-out Orders and to communicate to us any rejection promptly. We will notify you as soon as reasonably<br />\r\npossible if a Restaurant rejects your Take-out Order. Restaurants have the discretion to reject Take-out<br />\r\nOrders at any time and for any reason.</p>\r\n\r\n<p><br />\r\n5. REJECTION OF TAKE-OUT ORDERS</p>\r\n\r\n<p><br />\r\nIf your Take-out Order is subsequently rejected by the Restaurant or cancelled for any other reason,<br />\r\nyour bank or card issuer will not transfer the funds for the Take-out Order to us, but will instead release the<br />\r\nrelevant amount back into your available balance. This may take a period of time which is entirely<br />\r\ndependent upon your bank or card issuer. You acknowledge and agree that neither Company nor the<br />\r\nrelevant Restaurant will be responsible or liable to you in relation to any by your bank or card issuer in the<br />\r\nrelease of funds back into your account.</p>\r\n\r\n<p><br />\r\n3</p>\r\n\r\n<p><br />\r\n6. DELIVERY OF TAKE-OUT ORDERS<br />\r\nWhen you place a Take-out Order through the Platform for delivery to you, you may choose the time<br />\r\nwhen you would like your Take-out Order to be delivered to yo