(63, 'faq', '<p>PICKUP &amp; DELIVERY AGREEMENT</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>THIS PICKUP &amp; DELIVERY AGREEMENT (the &quot;Agreement&quot;), made effective the 15th day of September, 2018 (the &quot;Effective Date&quot;),</p>\r\n\r\n<p>is by and between DITCH THE KITCHEN INC. operating in Alberta under the registered trade name and style of DITCH THE KITCH (&quot;Company&quot;) and the party set forth and described as Courier on the execution page of this Agreement (&quot;Courier&quot;), (Company and Courier are individually referred to as a &quot;Party&quot; and together referred to as the &quot;Parties&quot;).</p>\r\n\r\n<p><br />\r\nRECITALS</p>\r\n\r\n<p><br />\r\nWHEREAS Company is engaged in the business of providing an Internet-based take-out order platform called DITCH THE KITCH (the &quot;Platform&quot;) that enables registered users thereof (&quot;Customers&quot;) to place take-out orders for food and beverages (&quot;Take-out Orders&quot;) for pick-up and delivery with various restaurants and other businesses (&quot;Providers&quot;).</p>\r\n\r\n<p><br />\r\nAND WHEREAS Courier is an independent service provider who is willing and able to pick up Take-out Orders from Providers and deliver them to Customers in accordance with the terms describe herein (the &quot;Services&quot;).</p>\r\n\r\n<p><br />\r\nNOW THEREFORE in consideration of the covenants expressed herein and the terms and conditions hereinafter set out, and the exchange of other good and valuable consideration between the Parties, the receipt and sufficiency of which is hereby acknowledged, the Parties covenant and agree as follows:</p>\r\n\r\n<p><br />\r\n1. Scope of Agreement</p>\r\n\r\n<p><br />\r\n(a) The terms and conditions set out and described in Schedule A hereto (the &quot;Terms &amp; Conditions&quot;) are hereby incorporated in and made part of this Agreement.<br />\r\n(b) The Terms &amp; Conditions shall apply to all Take-out Orders picked up from Providers and delivered to Customers by Courier through the Platform.<br />\r\n(c) In the event of any conflict between the Terms &amp; Conditions and this Agreement, this Agreement shall prevail.<br />\r\n(d) This Agreement may only be amended, supplemented or otherwise modified by written agreement of the Parties.</p>\r\n\r\n<p><br />\r\n2. Dispute Resolution</p>\r\n\r\n<p><br />\r\n(a) The Parties will attempt to resolve any dispute between them arising under this Agreement through consultation and negotiation in good faith.<br />\r\n(b) If the Parties are unable to first resolve any dispute between them arising under this Agreement through consultation and negotiation in good faith, they agree to submit the dispute to binding mediation and must agree upon an independent mediator and the process for mediation, failing which upon the application of either Party the mediator shall be designated by a judge of the Alberta Court of Queen&#39;s Bench.<br />\r\n(c) During the existence of any dispute, the Parties shall continue to perform all of their obligations under this Agreement without prejudice to their position in respect of such dispute, unless the Parties otherwise agree.</p>\r\n\r\n<p><br />\r\n3. Assignment, Binding Effect; Entire Agreement; Further Assurances</p>\r\n\r\n<p><br />\r\n(a) Neither this Agreement nor any of the rights, interests or obligations hereunder shall be assigned by Courier without the prior written consent of Company.<br />\r\n(b) This Agreement shall be binding on and shall enure to the benefit of the Parties and their respective successors and permitted assigns.</p>\r\n\r\n<p><br />\r\n2</p>\r\n\r\n<p><br />\r\n(c) This Agreement (including Schedule A hereto) constitutes the entire agreement between the Parties and supersedes all other prior agreements and understandings, both written and oral, between the Parties with respect to the subject matter hereof.<br />\r\n(d) Each Party shall, from time to time and at all times hereafter, at the request of the other Party, but without further consideration, do all such further acts and things, and execute and deliver all such further documents and instruments and provide all such further assurances as may be reasonably required in order to fully perform and carry out the terms and intent hereof.</p>\r\n\r\n<p><br />\r\n4. Notices; Independent Legal Advice</p>\r\n\r\n<p><br />\r\n(a) Any notice given or made under this Agreement (excluding Take-out Order Notifications made through the Platform) must be delivered to the intended recipient by hand or email to the address or email address set out below the signature of the Party on the execution page of this Agreement, or to such other address or email address as a Party may designate in writing from time to time.<br />\r\n(b) Verbal communications shall not constitute formal communication or notice under this Agreement and no Party has any obligation to act on any verbal communication or instruction unless and until it is confirmed in writing. Any action taken by a Party based on any verbal communication, instruction or assurance shall be at that Party&#39;s sole risk and shall be without liability to or recourse against the other Party.<br />\r\n(c) Courier acknowledges that it has been advised to obtain independent legal advice with respect to this Agreement; it has obtained independent legal advice or has expressly determined not to seek such advice; and it is entering into this Agreement of its own free will with full knowledge of the contents of this Agreement and its rights and obligations under this Agreement.</p>\r\n\r\n<p><br />\r\n5. Governing Law; Severability</p>\r\n\r\n<p><br />\r\n(a) This Agreement will be treated as a contract made in the Province of Alberta. This Agreement will be subject to and be interpreted and enforced in accordance with the laws in effect in the Province of Alberta, including the federal laws of Canada applicable therein.<br />\r\n(b) Subject to the dispute resolution processes in Section 2, each Party accepts the exclusive jurisdiction of the courts of the Province of Alberta and all courts of appeal therefrom with respect to the Agreement and any associated legal proceedings between the Parties.<br />\r\n(c) If anything in this Agreement is unenforceable, illegal or void then it is severed and the rest of this Agreement remains in full force and effect.<br />\r\n(d) Where a provision of this Agreement is prohibited or unenforceable, the Parties shall negotiate in good faith to replace the invalid provision by a provision which is in accordance with applicable law and which must be as close as possible to the Parties&#39; original intent and appropriate consequential amendments (if any) shall be made to this Agreement.</p>\r\n\r\n<p><br />\r\n6. Counterparts; Execution</p>\r\n\r\n<p><br />\r\n(a) This Agreement may be executed in two or more counterparts, each of which shall be deemed to be an original but all of which together shall constitute one and the same instrument.<br />\r\n(b) The Parties shall be entitled to rely upon delivery of an executed electronic copy of this Agreement (including PDF transmitted by email), and such executed electronic copy shall be legally effective to create a valid and binding agreement between the Parties.</p>\r\n\r\n<p><br />\r\n3</p>\r\n\r\n<p><br />\r\n(c) Each person signing this Agreement as an authorized officer of a Party hereby represents and warrants that he or she is duly authorized to sign this Agreement for that Party and that this Agreement shall, upon having been so executed, be binding on that Party in accordance with its terms.<br />\r\nIN WITNESS WHEREOF the Parties have executed this Agreement as of the date and year first written above.</p>\r\n\r\n<p><br />\r\nDITCH THE KITCHEN INC. operating under the registered trade name and style of DITCH THE KITCH<br />\r\nPer: Ronald Ala, President<br />\r\nADDRESS: 417 Arbour Lake Dr. NW Calgary, Alberta T3G 5G2<br />\r\nEMAIL ADDRESS: info@ditchthekitch.ca<br />\r\nCOURIER<br />\r\n[Print Name] [Signature]<br />\r\nADDRESS: ● ●<br />\r\nEMAIL ADDRESS: ●</p>\r\n\r\n<p><br />\r\n4</p>\r\n\r\n<p><br />\r\nSCHEDULE A TERMS AND CONDITIONS</p>\r\n\r\n<p><br />\r\n1. Definitions<br />\r\n&quot;Applicable Law&quot; means, in relation to any Person, transaction or event, all applicable provisions of Laws, statutes, rules, regulations, official directives and orders of and the terms of all judgments, orders and decrees issued by any Governmental Authority by which such Person is bound or having application to the transaction or event in question;<br />\r\n&quot;Company&rsquo;s Trade-marks&quot; means all Trade-marks owned or licensed by Company;<br />\r\n&quot;Confidential Information&quot; means, with respect to a Disclosing Party, all information in whatever form, including without limitation, verbal and written communications, licenses, technical and scientific information, computer programs, business plans, trade secrets, recipes, formulae, intellectual property processes, designs, data, formulae, prototypes, specifications, know-how, improvements, inventions (whether patentable or not), techniques, customers lists, business opportunities, agreements, electronic documents, sketches, photographs, source code, research, analytics, financial and accounting books and records, specifications, reports, correspondence and other forms of documents or copies thereof that are indirectly or directly conceived, originated, prepared or received by either Party in accordance with this Agreement and as a result of the performance of the Services by Courier and which may be in any form or medium and whether or not designated as confidential (or like designation), except information falling into any of the following categories:</p>\r\n\r\n<p><br />\r\n(a) information that the Receiving Party may demonstrate was at the time of disclosure or acquisition, already known by the Receiving Party and was not acquired under any obligation of confidentiality;<br />\r\n(b) information that at the time of disclosure or acquisition is or thereafter becomes part of the public domain through no act or failure to act on the part of the Receiving Party or on the part of any third party under an obligation of confidentiality with respect to the information; and<br />\r\n(c) information that is disclosed, either directly or indirectly, to either party via a third party who did not acquire the information under an obligation of confidentiality.<br />\r\n&quot;Governmental Authority&quot; means any federal, provincial, territorial, local or foreign government or political subdivision thereof, or any agency or instrumentality of such government or political subdivision, or any self-regulated organization or other non-governmental regulatory authority or quasi-governmental authority (to the extent that the rules, regulations or orders of such organization or authority have the force of Law), or any arbitrator, court or tribunal of competent jurisdiction;<br />\r\n&quot;Governmental Order&quot; means any order, writ, judgment, injunction, decree, stipulation, award or determination entered by or with any Governmental Authority;<br />\r\n&quot;Intellectual Property Rights&quot; means all intellectual property and industrial property rights comprising or relating to the Platform and the following:</p>\r\n\r\n<p>(a) Patents;</p>\r\n\r\n<p>(b) Trade-marks;</p>\r\n\r\n<p>(c) internet domain names, whether or not Trade-marks, registered by any authorized private registrar or Governmental Authority, web addresses, web pages, website and URLs;</p>\r\n\r\n<p>(d) works of authorship, expressions, designs and design registrations, whether or not copyrightable, including copyrights and copyrightable works, software and firmware, application programming interfaces, architecture, files, records, schematics, data, data files, and databases and other specifications and documentation;</p>\r\n\r\n<p>(e) Trade Secrets; and</p>\r\n\r\n<p>(f) all other intellectual property and industrial property rights, and all rights, interests and protections that are associated with, equivalent or similar to, or required for the exercise of, any of the foregoing, however arising, in each case whether registered or unregistered and including all registrations and applications for, and renewals or extensions of, such rights or forms of protection pursuant to the Laws of any jurisdiction throughout any part of the world;</p>\r\n\r\n<p><br />\r\n&quot;Law&quot; means any statute, law, ordinance, regulation, rule, code, constitution, treaty, common law, Governmental Order or other requirement or rule of law of any Governmental Authority;</p>\r\n\r\n<p><br />\r\n5</p>\r\n\r\n<p><br />\r\n&quot;Patents&quot; means all patents (including all reissues, divisionals, re-examinations, renewals, substitutions and extensions thereof), patent applications, and other patent rights and any other Governmental Authority-issued indicia of invention ownership (including inventor&#39;s certificates, petty patents and patent utility models);<br />\r\n&quot;Person&quot;means any individual, firm, corporation, company, body corporate, partnership, association, joint venture, trust, government or governmental body, agency or authority;<br />\r\n&quot;Personal Information&quot; means any information obtained through the Platform or in connection with this Agreement that (a) identifies or can be used to identify an individual (including without limitation, names, telephone numbers, addresses, signatures, email addresses or other unique identifiers); or (b) can reasonably be used to authenticate an individual (including without limitation, name, contact information, precise location information, access credentials, persistent identifiers and any information that may be considered personal data or personal information under Applicable Law;<br />\r\n&quot;Term&quot; has the meaning set forth in Section 8;<br />\r\n&quot;Territory&quot; means the City of Calgary in the Province of Alberta;<br />\r\n&quot;Trade-marks&quot; means all rights in and to Canadian and foreign trade-marks, service marks, trade dress, trade names, brand names, logos, trade dress, corporate names and domain names and other similar designations of source, sponsorship, association or origin, together with the goodwill symbolized by any of the foregoing, in each case whether registered or unregistered and including all registrations and applications for, and renewals or extensions of, such rights and all similar or equivalent rights or forms of protection in any part of the world; and<br />\r\n&quot;Trade Secrets&quot; means all inventions, discoveries, trade secrets, business and technical information and know-how, databases, data collections, patent disclosures and other confidential and proprietary information and all rights therein.<br />\r\n2. Courier Services<br />\r\n(a) When a Customer places a Take-out Order for pick-up and delivery through the Platform, the Platform will issue a notification to Courier that the Take-out Order has been placed and will be available for pickup from the Provider and delivery to the Customer (a &quot;Take-out Order Notification&quot;).<br />\r\n(b) If Courier accepts a Take-out Order Notification and receives confirmation of its acceptance through the Platform, Courier agrees to:<br />\r\n(i) promptly pick up the Take-out Order from the Provider&#39;s location;<br />\r\n(ii) confirm with the Provider at the time of pickup that the Take-out Order has been accurately completed in accordance with the Customer&rsquo;s order; and (iii) place the Take-out Order in [the Ditch the Kitch delivery bag] and deliver the Take-out Order to the Customer&#39;s address.<br />\r\n(c) Courier will accept, confirm, and deliver Take-out Orders in a prompt and timely manner using the skill, care, diligence and quality control consistent with best industry practices and all Applicable Laws. Courier covenants and agrees with Company that Courier shall:<br />\r\n(i) take into account any Customer comments or instructions included in the Take-out Orders with respect to delivery of the Take-out Orders;<br />\r\n(ii) perform the Services in a careful, honest and professional manner and comply in all aspects with this Agreement;<br />\r\n6<br />\r\n(iii) perform the Services with the standard of care, skill and diligence normally provided by a Person experienced in the performance of services similar to the Services called for in this Agreement;<br />\r\n(iv) devote such time and attention to the performance of the Services as is required and necessary to complete the Services in accordance with the terms and conditions of this Agreement;<br />\r\n(v) adhere to the policies, procedures and rules established by Company and communicated to Courier from time to time, as may be amended by Company at its sole discretion from time to time;<br />\r\n(vi) at all times during performance of the Services cooperate with employees and other consultants of Company (including Provider); and<br />\r\n(vii) observe, obey and comply with all Applicable Laws imposed by any Governmental Authority or any other duly constituted authority having jurisdiction with respect to the Services or the Parties and shall from time to time furnish Company with such evidence of compliance as Company may require.<br />\r\n(c) Courier will not delegate the Services to any other person or entity without the prior written consent of Company.<br />\r\n(d) Courier acknowledges and agrees that:<br />\r\n(i) Take-out Order Notifications are issued by Company through the Platform on a non-exclusive and first-to-be-accepted basis;<br />\r\n(ii) Courier may, but is not obligated to, accept a Take-out Order Notification; and<br />\r\n(iii) Company neither represents nor warrants to Courier that it will obtain any particular volume of Take-out Orders under the Platform or will profit from performing the Services.<br />\r\n3. Independent Contractor Relationship<br />\r\n(a) In performing the Services, Courier is acting as an independent contractor to Company and is legally authorized to work in Canada and perform the Services. It is understood that nothing in this Agreement shall be deemed to constitute Courier as an agent, representative, partner or employee of Company and the Parties expressly deny such association. Company has no direction or control over Courier except in the results to be obtained. The actual performance and supervision of the Services will solely be by Courier. Courier shall regularly confer with Company as to Company&#39;s expectations for Courier&#39;s performance hereunder, as well as the time frames applicable for Courier&#39;s performance of the Services.<br />\r\n(b) In performing the Services, Courier will be solely responsible for determining which Take-out Order Notifications to accept and the manner, method and means by which it performs the Services. Courier will, at its sole cost and expense, obtain and maintain a valid operator&#39;s/driver&#39;s licence, [purchase from Company a Ditch the Kitch delivery bag], provide all other necessary equipment and resources (including a GPS-enabled smartphone and transportation) to perform the Services, and obtain and maintain all other required legal authorizations to perform the Services. Courier will be responsible for all maintenance, repairs or replacements for such equipment and materials if damaged in any way during the course of providing the Services. Courier shall provide to Company a copy of each of its operator&#39;s/driver&#39;s license and other legal authorizations prior to performing the Services.<br />\r\n(c) Courier warrants and confirms that it has no past criminal convictions and agrees to provide Company with, and consents to Company obtaining, a Level 1 Security Screening Check of Courier prior to performing the Services. Courier agrees to forthwith notify Company in the event of any proceedings, investigations, actions, complaints, judgments or settlements indicated against Courier in any criminal or civil matter.<br />\r\n(d) All responsibilities undertaken by Courier in connection with the Services will be undertaken in the name of Courier and not in the name of Company. Courier has no authority to make any statements, representations or commitments on behalf of Company in connection with the Program or the Services.</p>\r\n\r\n<p><br />\r\n7</p>\r\n\r\n<p><br />\r\n(e) Company may enter into similar arrangements with other parties to provide the Services; and Courier may provide services similar to the Services to other parties.</p>\r\n\r\n<p><br />\r\n4. Compensation</p>\r\n\r\n<p><br />\r\n(a) Unless otherwise agreed to in writing by the Parties and except as provided below, Courier will be compensated for the Services according to the rates, at the times and in the manner set out in Exhibit 1 attached to this Schedule A, but otherwise is not entitled to any other payments or benefits in connection with performing the Services.<br />\r\n(b) Company&#39;s payment software may permit Customers to add a tip or gratuity to the Take-out Order, which Company shall pay to Courier in conjunction with payment under subparagraph (a). Customers may also pay a tip or gratuity on the Take-out Order in cash to Courier, which Courier shall be entitled to retain in full.</p>\r\n\r\n<p><br />\r\n5. Insurance</p>\r\n\r\n<p><br />\r\n(a) Courier shall maintain at its sole cost and expense during the term of this Agreement policies of insurance for the following types of coverage:<br />\r\n(i) if applicable, workers&#39; compensation insurance in accordance with the statutory and regulatory requirements of the province of Alberta;<br />\r\n(ii) automobile liability insurance covering all motor vehicles owned or leased and licensed by Courier with a combined single limit of $2,000,000.00 Canadian dollars for injury or death of one or more persons, or damage to or destruction of property as a result of any one accident; and<br />\r\n(iii) commercial general liability insurance in such minimum amount and scope as Company considers appropriate.<br />\r\n(b) Courier shall provide to Company copies of applicable insurance certificates upon Company&#39;s written request.</p>\r\n\r\n<p><br />\r\n6. Intellectual Property Rights</p>\r\n\r\n<p><br />\r\n(a) Courier acknowledges and agrees that:<br />\r\n(i) any and all Company&rsquo;s Intellectual Property Rights are the sole and exclusive property of Company or its licensors;<br />\r\n(ii) Courier shall not acquire any ownership interest in any of Company&rsquo;s Intellectual Property Rights under this Agreement;<br />\r\n(iii) any goodwill derived from the use by Courier of Company&rsquo;s Intellectual Property Rights inures to the benefit of Company or its licensors, as the case may be;<br />\r\n(iv) if Courier acquires any Intellectual Property Rights in or relating to the Platform or any other Intellectual Property Rights of the Company (including any rights in any Trade-marks, derivative works or patent improvements relating thereto), by operation of Law, or otherwise, such rights are deemed and are hereby irrevocably assigned to Company or its licensors, as the case may be, without further action by either of the Parties; and<br />\r\n(v) Courier shall use Company&rsquo;s Intellectual Property Rights solely for the purposes of performing its obligations under this Agreement and only in accordance with this Agreement and the instructions of Company.<br />\r\n(b) Subject to the terms and conditions of this Agreement, Company hereby grants to Courier a non-exclusive, non-transferable and non-sublicensable license to use Company&rsquo;s Trade-marks in the Territory during the Term solely on or in connection with Courier&rsquo;s performance of Services as contemplated under this Agreement. Courier will</p>\r\n\r\n<p><br />\r\n8</p>\r\n\r\n<p><br />\r\npromptly discontinue the display or use of any Trade-mark to change the manner in which a Trade-mark is displayed or used when requested by Company.<br />\r\n(c) Courier shall not, and shall not cause or encourage Customers, Providers or any other party to:<br />\r\n(i) take any action that may interfere with any of Company&rsquo;s rights in or to Company&rsquo;s Intellectual Property Rights, including Company&rsquo;s ownership or exercise thereof;<br />\r\n(ii) challenge any right, title or interest of Company in or to Company&rsquo;s Intellectual Property Rights;<br />\r\n(iii) make any claim or take any action adverse to Company&rsquo;s ownership of Company&rsquo;s Intellectual Property Rights;<br />\r\n(iv) register or apply for registrations, anywhere in the world, for Company&rsquo;s Trade-marks or any other Trade-mark that is similar to Company&rsquo;s Trade-marks or that incorporates Company&rsquo;s Trade-marks in whole or in confusingly similar part;<br />\r\n(v) use any mark, anywhere, that is confusingly similar to Company&rsquo;s Trade-marks;<br />\r\n(vi) engage in any action that tends to disparage, dilute the value of, or reflect negatively on any Company Trade-mark;<br />\r\n(vii) misappropriate any of Company&rsquo;s Trade-marks for use as a domain name without prior written consent from Company; and<br />\r\n(viii)alter, obscure or remove any of Company&rsquo;s Trade-marks or trade-mark or copyright notices or any other proprietary rights notices, marketing materials or other materials that Company may provide.<br />\r\n(d) On expiration or earlier termination of this Agreement, Courier will immediately cease all display, advertising, promotion and use of all of Company&rsquo;s Trade-marks and will not thereafter use, advertise, promote or display any Trade-mark or any part thereof that is similar to or confusing with Company&rsquo;s Trade-marks or with any Trade-mark associated with Company.</p>\r\n\r\n<p><br />\r\n7. Indemnity</p>\r\n\r\n<p><br />\r\n(a) As a result of, or in connection with any negligence, omission or wilful misconduct in the performance of this Agreement by Courier, or any breach of any representation, warranty or covenant made by Courier hereunder, Courier to the fullest extent allowed by Applicable Law:<br />\r\n(i) shall be liable to Company and/or any of its directors, officers, shareholders, employees, agents, consultants or others for whom Company is responsible (collectively, &quot;Company&rsquo;s Representatives&quot;) for any and all actions, suits, proceedings, claims, demands, losses, costs, damages of whatsoever nature or kind (including legal fees on a solicitor and its own client basis) and any expenses whatsoever which Company or Company&rsquo;s Representatives may suffer, sustain, pay or incur; and</p>\r\n\r\n<p><br />\r\n(ii) as a separate and independent covenant, shall indemnify Company and Company&rsquo;s Representatives for any and all actions, suits, proceedings, claims, demands, losses, costs, damages of whatsoever nature or kind (including legal fees on a solicitor and its own client basis) and any expenses whatsoever which may be brought by a third party against Company or Company&rsquo;s Representatives or which any of them may suffer, sustain, pay or incur.</p>\r\n\r\n<p><br />\r\n8. Term and Termination</p>\r\n\r\n<p><br />\r\n(a) The Agreement shall commence on the Effective Date and shall terminate subject to the provisions of this Section 8 (the &quot;Term&quot;).</p>\r\n\r\n<p><br />\r\n9</p>\r\n\r\n<p><br />\r\n(b) Either Party may terminate this Agreement for any reason by providing ten (10) days&#39; written notice to the other Party hereto, and Company shall pay all amounts due to Courier hereunder up to the date of termination in accordance with the provisions set out in ●.<br />\r\n(b) All provisions which by their nature or terms survive termination of this Agreement, and all obligations of the Parties which arise prior to or as a result of termination of this Agreement, shall survive termination of this Agreement. The fact of termination of this Agreement shall not relieve any Party of its obligation to perform acts contemplated to be performed after termination.</p>\r\n\r\n<p><br />\r\n9. Data Privacy</p>\r\n\r\n<p><br />\r\n(a) For purposes of this Section 9, &quot;Company Data&quot; means any information that Company provides or makes accessible to Courier through the Platform, including without limitation Personal Information.<br />\r\n(b) Courier agrees not to access, collect, store, retain, transfer, use or otherwise process in any manner Company Data, including without limitation Personal Information, except as required to perform under this Agreement. Courier shall keep Company Data secure from unauthorized access and maintain the accuracy and integrity of Company Data in Courier&rsquo;s custody or control by using appropriate organizational, physical and technical safeguards. If Courier becomes aware of any unauthorized access to Company Data, Courier will immediately notify Company, consult and cooperate with investigations and potentially required notices, and provide any information reasonably requested by Company.<br />\r\n(c) Courier will comply at all times with all Applicable Laws regarding the collection, retention, use, processing, disclosure, transfer and protection of personal information, and all the data breach notification requirements.</p>\r\n\r\n<p><br />\r\n10. Courier Information</p>\r\n\r\n<p><br />\r\n(a) Courier acknowledges that this Agreement requires Courier to provide certain personal information to Company. Such information is being collected by Company for the purposes of assessing the qualification and eligibility of Courier to perform the Services hereunder and conducting its due diligence upon Courier.<br />\r\n(b) Courier&#39;s personal information may be disclosed by Company to any party that Company reasonably considers necessary to involve in the foregoing assessment and due diligence, and by executing this Agreement, Courier is deemed to be consenting to the foregoing collection, use and disclosure of Courier&#39;s personal information and to the distribution of copies of any of the documents as may be required to be provided by Courier in connection with the transactions contemplated hereby.</p>\r\n\r\n<p><br />\r\n11. Confidentiality</p>\r\n\r\n<p><br />\r\n(a) No announcement shall be made by either Party on the subject matter of this Agreement unless and before agreed to in writing by the other Party or required by Applicable Law. Press releases in respect of the transactions contemplated by this Agreement shall be made only by a Party with the prior written approval of the other Party.<br />\r\n(b) Each Party (the &quot;Receiving Party&quot;) shall treat any and all Confidential Information disclosed to it by the other Party (the &quot;Disclosing Party&quot;) pursuant to this Agreement as confidential, including information concerning the Projects or the transactions contemplated hereby disclosed before or after the Effective Date.<br />\r\n(c) Unless otherwise agreed to herein, the Receiving Party shall not, unless authorized by the Disclosing Party to do so:<br />\r\n(i) copy, reproduce, distribute or disclose to any Person any of the Confidential Information, or any facts related thereto;<br />\r\n(ii) permit any third party to have access to such Confidential Information; or</p>\r\n\r\n<p><br />\r\n10</p>\r\n\r\n<p><br />\r\n(iii) use such Confidential Information for any purpose other than for the purpose of performing its obligations under this Agreement.<br />\r\n(d) The Disclosing Party hereby authorizes the Receiving Party to disclose Confidential Information to its consultants as necessary to assist the Receiving Party in exercising its rights and obligations hereunder; provided, however, that Receiving Party shall require such Persons to treat Confidential Information in a manner consistent with this Agreement.<br />\r\n(e) In the event that the Receiving Party is requested in any legal proceeding or by any Governmental Authority to disclose any Confidential Information, the Receiving Party shall, to the extent permitted under Applicable Law, give the Disclosing Party prompt notice of such request so that the Disclosing Party may seek an appropriate protective order. If, in the absence of a protective order, Receiving Party is nonetheless advised by counsel that disclosure of the Confidential Information is required (after exhausting any appeal requested by the Disclosing Party at the Disclosing Party&rsquo;s expense and permitted under Applicable Law), the Receiving Party may disclose such Confidential Information without liability hereunder provided that only such portion of the Confidential Information required to be disclosed shall be made available.<br />\r\n(f) The Receiving Party acknowledges and agrees that the Disclosing Party will suffer irreparable harm in the event of any breach of the Receiving Party&rsquo;s obligations under this Section 11 for which money damages would not be a sufficient remedy, and the Disclosing Party will be entitled to specific performance and injunctive relief as remedies for any such breach, plus legal fees and court costs incurred in pursuing such remedies. Such remedies will not be deemed to be exclusive remedies to the Disclosing Party for a breach of this Section 11 by the Receiving Party but will be in addition to all other remedies at law or in equity.</p>'),
